import React, { useState } from "react";
import "../../Estilos/login.css";
import IMG from '../../Imagenes/IMG';

const Login = ({ onLogin }) => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (e) => {
    e.preventDefault();
    // Aquí podrías agregar la lógica para autenticar el usuario
    // Por simplicidad, aquí simplemente llamaremos al onLogin con el username
    onLogin(username);
  };

  return (
    <div className="login-container">
      <h2>Acceso al Sistema</h2>
      <img src={IMG.img15} alt="" style={{ width: '50%', height: '170px', marginLeft: '10%', marginTop: '20px', marginBottom: '20px',}} />


        <div style={{marginRight: '10px', marginLeft: '10px', width: '70%', marginBottom:'20px' }}>
          <label>Usuario:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="jd9909hh"
          />
        </div>


      <div style={{ marginRight: '10px', marginLeft: '10px', width: '70%', marginBottom:'20px' }}>
        <label>Contraseña:</label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          placeholder="887837373"
        />
      </div> 


      <button type="submit" style={{ marginLeft: '15px' }} onClick={handleLogin}>
        Acceder
      </button>
    </div>
  );
};


export default Login;
